import { React, useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { IconButton } from '@mui/material';
import BookmarkBorderIcon from '@mui/icons-material/BookmarkBorder';
import BookmarkIcon from '@mui/icons-material/Bookmark';
import "./Accommodation.css";
import Loading from "components/Loading";


// the accommodation card
// displays: photos of the accommodation
//           details below
export default function AccommCard({ isLoggedIn, email, accomm }) {
    let navigate = useNavigate();
    const [bookmarked, setBookmarked] = useState(false);
    const [loading, setLoading] = useState(true);
    useEffect(() => {
        if (isLoggedIn) {
            fetch('http://localhost:3001/checkIfBookmarked', {
                method: 'POST',
                credentials: 'include',
                body: JSON.stringify({
                    user: email,
                    accomm: accomm._id   
                }),
                headers: {
                    'Content-Type': "application/json"
                }
            })
            .then(res => res.json())
            .then(body => {
                if(body.success){
                    setBookmarked(body.bookmarked)
                }
                setLoading(false)
            })
        }
        setLoading(false)
    }, [])


    const addBookmark = (accomm_id) => {
        fetch('http://localhost:3001/bookmarkAccomm', {
            method: 'POST',
            credentials: 'include',
            body: JSON.stringify({
                email: email,
                accomm_id: accomm_id
            }),
            headers: {
                'Content-Type': "application/json"
            }
        })
            .then(res => res.json())
            .then(body => {
                if (body.success) {
                    setBookmarked(true);
                } else {
                    alert(body.msg);
                }
        })
    }

    const removeBookmark = (accomm_id) => {
        fetch('http://localhost:3001/removeBookmarkAccomm', {
            method: 'POST',
            credentials: 'include',
            body: JSON.stringify({
                user: email,
                accomm_id: accomm_id
            }),
            headers: {
                'Content-Type': "application/json"
            }
        })
        .then(res => res.json())
        .then(body => {
            if (body.success) {
                setBookmarked(false);
            } else {
                alert(body.msg);
            }
        })
    }

    const clickBtn = (id) => {
        if (!isLoggedIn) { // can't click the button
            alert("Please log in to bookmark this accommodation."); // change to pop-up
            navigate('/login');
        } else {
            // check button value
            if (bookmarked) {
                removeBookmark(id);
            }
            else {
                addBookmark(id);
            }
        }
    }
    return (
        <>
            {loading ?
            <Loading />
            :
            <div className="body-element">
            {/* bookmark button */}
            <IconButton key={accomm._id} onClick={() => clickBtn(accomm._id)} className="favorite" >
                {bookmarked ? <BookmarkIcon id={accomm._id} /> : <BookmarkBorderIcon id={accomm._id} />}
            </IconButton>

        {/* image/s */}
        { /* reference: https://www.youtube.com/watch?v=McPdzhLRzCg */ }

            <div onClick={() => {navigate("/accomm?id=" + accomm._id)}}>
                <div className="img-container">
                    <div className="slider-wrapper">
                        <div className="images">
                            {accomm.photos.map((photo, index) => {
                                return <img id={"image-" + photo + "-" + index} src={require("assets/" + photo)} alt='' />
                            })}
                        </div>
                        {/* slider buttons */}
                        <div className="slider-btns">
                            {accomm.photos.map((photo, index) => {
                                return <a href={"#image-" + photo + "-" + index}></a>
                            })}
                        </div>
                    </div>
                </div>
                {/* details */}
                <div className="details">
                    <h3>{ accomm.name}</h3>
                    <p>{`${accomm.address.street } ${accomm.address.barangay}, ${accomm.address.city}`}</p>
                    <p>{`Type: ${accomm.accommodationType}`}</p>
                    <h4>{`₱${accomm.priceRange.minPrice}.00 - ${accomm.priceRange.maxPrice}.00`}</h4>
                </div>
            </div>
        </div>

            }
        </>
    )
}
